DROP DATABASE IF EXISTS coursework; 

CREATE DATABASE coursework;

Use coursework;


CREATE TABLE branch
(
BranchNo INT(10) UNIQUE,
BranchLocation VARCHAR(20) NOT NULL UNIQUE,
BranchPhoneNO VARCHAR(20) NOT NULL,
PRIMARY KEY(BranchNo)
);

CREATE TABLE salesassistant
(
SalesAssistantNo INT(10) UNIQUE,
SalesAssFirstName VARCHAR(15) NOT NULL,
SalesAssSecondName VARCHAR(15) NOT NULL,
BranchNo INT(10) NOT NULL,
PRIMARY KEY(SalesAssistantNo),
FOREIGN KEY (BranchNo) REFERENCES branch (BranchNo)
);

CREATE TABLE customer
(
CustNo INT(10) UNIQUE,
CustFirstName VARCHAR(20) NOT NULL,
CustSecondName VARCHAR(20) NOT NULL,
CustAddressLine1 VARCHAR(10) NOT NULL,
CustAddressLine2 VARCHAR(10) NOT NULL,
CustAddressLine3 VARCHAR(20) NOT NULL,
CustDOB DATE NOT NULL,
CustPhoneNo VARCHAR(20) NOT NULL,
CustEmail VARCHAR(20) UNIQUE NOT NULL,
PRIMARY KEY (CustNo)
);

CREATE TABLE supplier
(
SupplierNo INT(10) UNIQUE,
SupplierName VARCHAR(20) NOT NULL UNIQUE,
SupplierAddressLine1 VARCHAR(10) NOT NULL,
SupplierAddressLine2 VARCHAR(10) NOT NULL,
SupplierAddressLine3 VARCHAR(10) NOT NULL,
SupplierPhoneNo INT(11) NOT NULL UNIQUE,
SupplierEmail VARCHAR(20) NOT NULL UNIQUE,
PRIMARY KEY(SupplierNo)
);

CREATE TABLE product
(
ProductCode INT(10) UNIQUE,
ProductPrice INT(4) NOT NULL,
ProductCategory VARCHAR(15) NOT NULL,
ProductOfferPrice INT(4),
SupplierNo INT(10) NOT NULL,
PRIMARY KEY(ProductCode),
FOREIGN KEY (SupplierNo) REFERENCES supplier (SupplierNo)
);

CREATE TABLE shipping
(
ShippingNo INT(10) UNIQUE,
ShippingName VARCHAR(10) NOT NULL UNIQUE,
ShippingEmail VARCHAR(20) NOT NULL UNIQUE,
PRIMARY KEY(ShippingNo)
);

CREATE TABLE orders
(
BranchNo INT(10),
OrderDate DATE NOT NULL,
CustNo INT(10) NOT NULL,
TillNo INT(3) NOT NULL,
OrderNo INT(10) NOT NULL,
ShippingNo INT(10) NOT NULL,
SalesAssistantNo INT (10) NOT NULL,
PRIMARY KEY(OrderNo),
FOREIGN KEY(BranchNo) REFERENCES branch(BranchNo),
FOREIGN KEY(CustNo) REFERENCES customer(CustNo),
FOREIGN KEY(ShippingNo) REFERENCES shipping(ShippingNo),
FOREIGN KEY(SalesAssistantNo) REFERENCES salesassistant(SalesAssistantNo)
);

CREATE TABLE orderline
(
OrderNo INT(10),
Qty INT(3) NOT NULL,
ProductCode INT(10) NOT NULL,
PRIMARY KEY(OrderNo, ProductCode),
FOREIGN KEY(OrderNo) REFERENCES orders(OrderNo),
FOREIGN KEY(ProductCode) REFERENCES product(ProductCode)
);

















SELECT BranchNo, CustEmail, CustAddressLine1, CustAddressLine2, CustAddressLine3
FROM orders, customer
WHERE customer.CustNo = orders.CustNo
ORDER by BranchNo ASC;


SELECT orders.BranchNo, ProductPrice, qty, SalesassFirstName, SalesassSecondName, supplierNo, orders.CustNo, orders.Orderdate
FROM orders, salesassistant, product, orderline
WHERE SalesAssistant.SalesassistantNo = orders.SalesAssistantNo
AND product.productCode = orderline.productCode
AND orderline.OrderNo = orders.orderNO
AND orders.Orderdate ='2021-06-21'
ORDER by BranchNo ASC, orderdate DESC;

SELECT customer.CustNo, orders.OrderNo, product.ProductCode, product.ProductPrice, orderline.qty,
orderline.qty*product.ProductPrice AS total
FROM orders, customer, product, orderline
WHERE product.productCode = orderline.productCode
AND orderline.OrderNo = orders.orderNO
AND customer.CustNo = orders.CustNo
AND customer.CustNo = '215';


SELECT salesassistant.SalesassFirstName, salesassistant.SalesassSecondName, orders.OrderNo, orders.OrderDate
FROM orders, salesassistant
WHERE SalesAssistant.SalesassistantNo = orders.SalesAssistantNo
AND salesassistant.SalesassSecondName = 'Bunnell'
ORDER BY OrderDate DESC;


SELECT product.productCode, product.productPrice, orderline.qty, product.productPrice * orderline.qty as total, orders.OrderDate
FROM product, orders, orderline
WHERE orders.OrderNo = orderline.OrderNo
AND product.ProductCode = orderline.ProductCode
AND orders.OrderDate = '2021-06-21'
AND product.ProductCode = '33'
ORDER BY total ASC;